css:
/*	Alice in Wonderland Tumblr icons [recycled]
	recycled from "lewis carol alice in wonderland tumblr dash icons" (http://userstyles.org/styles/41899)
	by hide_header (http://userstyles.org/users/117864)
*/
@-moz-document
	url-prefix('http://www.tumblr.com/'),
	url-prefix('https://www.tumblr.com/')
{

a.new_post_label > i {
  height: 90px;
}
.new_post_label > I {
  background: url("data:image/jpeg;base64,") no-repeat !important;
  background-size: auto !important;
  z-index: -1;
  }

.new_post_label:nth-of-type(1) > I {background-position: -2px 0 !important}
.new_post_label:nth-of-type(2) > I {background-position: -78px 0 !important}
.new_post_label:nth-of-type(3) > I {background-position: -153px 0 !important}
.new_post_label:nth-of-type(4) > I {background-position: -230px 0  !important}
.new_post_label:nth-of-type(5) > I {background-position: -307px 0 !important}
.new_post_label:nth-of-type(6) > I {background-position: -383px 0 !important}
.new_post_label:nth-of-type(7) > I {background-position: -459px 0  !important}
.new_post_label > I {top: 4px !important}
.new_post_label:hover > I {top: 0 !important}
.new_post_label {
    padding: 77px 0 2px 1px !important;
    width: 75px !important;
    text-transform: lowercase;
  }
#new_post {padding-left: 0 !important}

.new_post_label > I {
  color: transparent !important;
  transition: background-position .08s linear !important;
  }

}
